def find_bottleneck(lst):
    left_sum = 1
    right_product = 1
    i = 0
    j = len(lst) - 1
    while i <= j and (not isinstance(lst[i], int)):
        i += 1
    while i <= j and (not isinstance(lst[j], int)):
        j -= 1
    if i > j:
        return -1
    left_sum = lst[i]
    right_product = lst[j]
    while i < j:
        if left_sum < right_product:
            i += 1
            while i < j and (not isinstance(lst[i], int)):
                i += 1
            if i < j:
                left_sum += lst[i]
        else:
            j -= 1
            while i < j and (not isinstance(lst[j], int)):
                j -= 1
            if i < j:
                right_product *= lst[j]
    return i if left_sum == right_product else -1

